social_posts.post_text:
Stopped by to see my friends on @localon2live to talk about @livelikegrunt and someone demanded screen time 🤷🏻‍♀️
@thelauraschweizer & @joebreezyradio were such pros rolling with it! 
(Thanks @daniellebreezytv for the video)

Posting anything ordinary feels wrong and “moving on” in something like this is just unfathomable. We are heartbroken & feel helpless. If you are looking for ways to donate or give back here are some fundraisers & businesses giving back. 

@communityfoundationmidtn 
https://www.cfmt.org/story/support-survivors-of-the-covenant-school-shooting/ 

